import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { Button, Text, View } from 'react-native';

// Componente da tela inicial (Stack principal)
function HomeScreen({ navigation }) {
  return (
    <View>
      <Text>Página Inicial</Text>
      <Button
        title="Ir para a navegação interna"
        onPress={() => navigation.navigate('InnerStack')}
      />
    </View>
  );
}

// Componente da primeira tela dentro do stack aninhado
function InnerScreen({ navigation }) {
  return (
    <View>
      <Text>Página interna 1</Text>
      <Button
        title="Ir para a página interna 2"
        onPress={() => navigation.navigate('InnerScreen2')}
      />
    </View>
  );
}

// Componente da segunda tela dentro do stack aninhado
function InnerScreen2() {
  return (
    <View>
      <Text>Página interna 2</Text>
    </View>
  );
}

// Stack aninhado
const InnerStack = createStackNavigator();
function InnerStackNavigator() {
  return (
    <InnerStack.Navigator>
      <InnerStack.Screen name="InnerScreen" component={InnerScreen} />
      <InnerStack.Screen name="InnerScreen2" component={InnerScreen2} />
    </InnerStack.Navigator>
  );
}

// Stack principal
const Stack = createStackNavigator();
export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Home" component={HomeScreen} />
        {/* O InnerStack está aninhado no Stack principal */}
        <Stack.Screen name="InnerStack" component={InnerStackNavigator} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
